<?php $__env->startSection('content'); ?><p>Jenna Coleman and Tom Hughes were spotted on Wednesday packing up and moving out of their London home.</p>

<p>The actor couple shocked fans when they split in July - having been a couple - on and off-screen - for four years.</p>

<p>But things seemed to be made final as the Victoria stars dealt with matters at their former shared property.</p>

<p>Moving out: Jenna Coleman and Tom Hughes were spotted on Wednesday packing up and moving out of their London home</p>

<p>Moving on: But things seemed to be made final as the Victoria stars dealt with matters at their former shared property</p>

<p>Tom, 35, was spotted briefly at the door, heading inside in a black coat and maroon hat.</p>

<p>Jenna, 34, looked spirited enough, strolling along outside on her phone, in a sweeping tan trench coat.</p>

<p>She wore a pink, cream, mustard and navy sweater with sweatpants and white trainers.</p>

<p>She wore a natural wash of make-up and her brunette locks loosely around her shoulders. </p>

<p>Spotted: Jenna, 34, looked spirited enough, strolling along outside on her phone, in a sweeping tan trench coat. She wore a pink, cream, mustard and navy sweater with sweatpants and white trainers</p>

<p>Loaded up: She wore a natural wash of make-up and her brunette locks loosely around her shoulders</p>

<p>Finito: Things seemed to be made final as the Victoria stars dealt with matters at their former shared property</p>

<p>Jenna was seen going back and forth to her parked car, loading items into the back of it. </p>

<p>They were seen handing over the keys to the house a few weeks ago, with Jenna said to be 'terribly sad' after splitting from Tom.</p>

<p>The actress and her Victoria co-star fell in love on set while playing the lead roles of Queen Victoria and Prince Albert in the ITV period costume drama.</p>

<p>Snaps showed the star handing over keys to her ex at the door of her new pad five miles from their home. </p>

<p>An insider told The Sun that the pair have since met up in an attempt to keep things 'as friendly and civil as possible.' </p>

<p>Upsetting: They were seen handing over the keys to the house a few weeks ago, with Jenna said to be 'terribly sad' after splitting from Tom</p>

<p>Packed away: Jenna was seen going back and forth to her parked car, loading items into the back of it</p>

<p>The source said: 'They are trying to salvage a friendship but obviously these are trying times, and it's not easy. </p>

<p>'Both Tom and Jenna are terribly sad, but the relationship ran its course. There was no third party involved.  </p>

<p>'Jenna's career is going from strength to strength, she's being offered increasingly more roles abroad, especially Los Angeles, and she wants to focus on this while she's still young.' </p>
